package kr.co.sist.badasaja.vo;

public class AdImgVO {
	private String afNum, img;

	public AdImgVO() {
		// TODO Auto-generated constructor stub
	}

	public AdImgVO(String afNum, String img) {
		this.afNum = afNum;
		this.img = img;
	}

	public String getAfNum() {
		return afNum;
	}

	public void setAfNum(String afNum) {
		this.afNum = afNum;
	}

	public String getImg() {
		return img;
	}

	public void setImg(String img) {
		this.img = img;
	}

}
